def CoolPara(words):
    split = words.split()
    length = len(split)
    print(length, 'words in the input paragraph')

    rarewords = 0 
    rare = ['j', 'x', 'q', 'z']
    for w in length:
        for char in w: 
            if char in rare:
                rarewords += 1
    print(rarewords, 'words with a rare character')


